import React from 'react';
import Authors from './Authors';
import './styles.css';

const ProfileDb = ({ profiles }) => {
  return (
    <div className='blogList-wrap'>
      {profiles.map((profile) => (
        <Authors profile={profile} />
      ))}
    </div>
  );
};

export default BlogList;
